import  { FC } from 'React';
import styled from 'styled-components';




const ExpandedMenuContet = styled.div`
`;

const MenuItem = styled.div`
`;
const HouseIcon = styled.img`
margin-left:10px;
`;
const PublicationsIcon = styled.img`
margin-left:10px;
`;

const PeopleIcon = styled.img`
margin-left:10px;
`;

const EntitiesIcon = styled.img`
margin-left:10px;
`;
const AdministrationIcon = styled.img`
margin-left:10px;
`;



export const ExpandedMenu: FC = () => {
    return(
     
            <ExpandedMenuContet>
                <MenuItem>
                <HouseIcon src="./media/icons/house.png"  alt="" />
                Home
                </MenuItem>
                <MenuItem>
                <PublicationsIcon src="./media/icons/Publications.png"  alt="" />
                Publications
                </MenuItem>
                <MenuItem>
                <PeopleIcon src="./media/icons/people.png"  alt="" />
                People
                </MenuItem>
                <MenuItem>
                <EntitiesIcon src="./media/icons/entities.png"  alt="" />
                Entities
                </MenuItem>
                <MenuItem>
                <AdministrationIcon src="./media/icons/administration.png"  alt="" />
                Administration
                </MenuItem>
            </ExpandedMenuContet>
      
    );
};
